import './App.css';
import { youtubeData } from './YoutubeData';
function App() {

  return (
    <div className='youtube-list'>

      {/* <YoutubeItem image="https://plus.unsplash.com/premium_photo-1695305000127-5a9a2588f441?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1892&q=80"
      avatar='https://images.unsplash.com/photo-1540786121371-70e1e61ac897?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1887&q=80'></YoutubeItem>
      <YoutubeItem image="https://plus.unsplash.com/premium_photo-1669638780803-ce74f7f3ea76?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw2NHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=500&q=60"
      avatar='https://images.unsplash.com/photo-1616683693504-3ea7e9ad6fec?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTF8fGJlYXV0aWZ1bCUyMHdvbWFufGVufDB8fDB8fHww&auto=format&fit=crop&w=500&q=60'></YoutubeItem>
      <YoutubeItem image="https://plus.unsplash.com/premium_photo-1695304999870-82aa83d7a759?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw3NXx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=500&q=60"
      avatar='https://images.unsplash.com/photo-1576828831022-ca41d3905fb7?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTZ8fGJlYXV0aWZ1bCUyMHdvbWFufGVufDB8fDB8fHww&auto=format&fit=crop&w=500&q=60'></YoutubeItem>
      <YoutubeItem image="https://images.unsplash.com/photo-1694267510052-feac0d872085?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw3OHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=500&q=60"
      avatar='https://images.unsplash.com/photo-1540875716262-8c2b2c4c00ff?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MjB8fGJlYXV0aWZ1bCUyMHdvbWFufGVufDB8fDB8fHww&auto=format&fit=crop&w=500&q=60' ></YoutubeItem> */}
      {youtubeData.map((item, index)  =>  {
        return(

          <YoutubeItem
          key = {item.id}
          image = {item.image}
          title = {item.title}
          avatar = {item.avatar || item.image}
          author = {item.author}
          className = {index == 1 ? 'abc':''}
          >

          </YoutubeItem>
        );
      })},
    </div>

  );
}
function YoutubeItem(props){
  return(
    <div className={`youtube-item ${props.className}`}>
      <div className='youtube-image'>
        <img src={props.image} alt=''>

        </img>
      </div>
      <div className='youtube-footer'>
        <img src={props.avatar} alt='' className='youtube-avatar'></img>
        <div className='youtube-info'>
          <h3 className='youtube-title'>{props.title || 'This is example'}</h3>
          <h4 className='youtube-author'>{props.author || 'This is example of author'}</h4>
        </div>
      </div>
    </div>
  );
}
export default App;
